import React from 'react';
import {Switch,Route} from 'react-router-dom';
import './App.css';
import routes from './pages/routes';

function App() {
  return (
    <Switch>
      {routes.map(({component:Component,path,...rest})=>{
        return <Route component={Component} key={path} {...rest} />
      })}
    </Switch>
  );
}

export default App;
